import React from 'react';
import './left_sb_option.css';

function Left_sb_option(props) {
  return (
    <div className='side__ber__option'>
      <div className='icon'>{props.Icon}</div>
      <h4>{props.name}</h4>
    </div>
  );
}

export default Left_sb_option;
